import React from 'react';

import { NavigationContainer } from '@react-navigation/native';
import { createNativeStackNavigator } from '@react-navigation/native-stack';

import Login from './src/pages/login';
import Cad_pet from './src/pages/Cadastrar_pets';
import List_pet from './src/func/Listagem_pet';

export {Cad_pet,Login};

const Stack = createNativeStackNavigator();

export default function App() {
  return (
    <NavigationContainer>
      <Stack.Navigator initialRouteName="Listar Pet" stackContent={props => <List_pet {...props}/>}>
        <Stack.Screen name="Login" component={Login}/>
        <Stack.Screen name="Cadastrar Pet" component={Cad_pet}/>
        <Stack.Screen name="Listar Pet" component={List_pet}/>
      </Stack.Navigator>
    </NavigationContainer>
  );
}
